import React from 'react'
import './Pin.css';

const Pin = ({ data }) => {
  return (
    <div className="grid">
      {data.map(item => (
        <div key={item._id} className="grid-item" tabindex="1">
          <img className="main-pic" src={item.name} alt={`Image ${item._id}`} />
        </div>
      ))}
        <div className="overlay"></div>
  <div className="instructions">Click anywhere to close.<br> </br> Use the [TAB] key to see the next image.</div>
    </div>
  );
};




export default Pin;
